import React from "react";
import "../App";
const NavBarTop = () => {
  return (
    <header>
      <nav className="bg-blue-200">
        <div className="flex justify-center space-x-4">
          <a
            href="/"
            className="text-white text-center bg-blue-500 hover:bg-blue-800 focus:ring-4 focus:ring-blue-300 font-medium rounded-3xl w-96 text-sm px-5 py-2.5 mr-2 mb-2 focus:outline-none dark:focus:ring-blue-800"
          >
            Trouver un Bricoleur
          </a>
        </div>
      </nav>
    </header>
  );
};

export default NavBarTop;
